import numpy as np

class Layer:

    def __init__(self, array, w_code, w_encode):
        self.array = array
        self.w_code = w_code
        self.w_encode = w_encode

    def code(self):
        return np.dot(self.array, self.w_code)

    def encode(self):
        return np.dot(self.array, self.w_encode)

